window.bookSummaryJSON = "<p>Their mission: search and destroy.</p> <p>Their target: classified.</p> <p>Their location: classified.</p> <p>The empire’s finest are gathered for a clandestine mission on a ruined planet. Their orders are sealed until they reach orbit. The stakes are higher than they realized, and the enemy will do anything to stop them. They’ll be lucky to survive. It’s going to take a miracle to succeed.</p>"; 
